CREATE TABLE `T_Job` (
  `job_Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '职位id',
  `job_Title` varchar(40) NOT NULL COMMENT '职位名称',
  `job_Simple_des` varchar(200) DEFAULT NULL COMMENT '职位简述',
  `job_Detail_des` mediumtext COMMENT '职位详述',
  `job_Enterprise_user_account` varchar(20) NOT NULL COMMENT '创建此职位的用人单位用户id',
  `job_Type_id` int(11) NOT NULL COMMENT '职位类型id',
  `job_Status_id` int(11) NOT NULL COMMENT '职位状态id',
  `job_Recruit_num` int(11) DEFAULT NULL COMMENT '招聘人数',
  `job_Year_low` int(11) DEFAULT NULL COMMENT '工作至少年限',
  `job_Year_high` int(11) DEFAULT NULL COMMENT '工作至多年限',
  `job_Salary_type_id` int(11) NOT NULL COMMENT '基本工资类型id',
  `job_Salary_less` int(11) DEFAULT NULL COMMENT '基本工资值a(如基本工资类型为“面议”则此项必须为空,若基本工资类型为“固定数额”则此项为数字,若基本工资类型为“范围”则此项为下限数字)',
  `job_Salary_high` int(11) DEFAULT NULL COMMENT '基本工资值b(只有再基本工资类型为“范围”时需要填写，此项为上限数字，如基本工资类型为“面议”则此项必须为空)',
  `job_Commission_type_id` int(11) NOT NULL COMMENT '职位佣金提成方式id',
  `job_Commission` decimal(8,2) NOT NULL COMMENT '职位佣金提成额(根据职位佣金提成方式id确定，如为额度，则填写数字，如为比例则填写百分比换算成小数如0.30代表30%)',
  `job_Start_date` date DEFAULT NULL COMMENT '有效期开始日期',
  `job_End_date` date DEFAULT NULL COMMENT '有效期结束日期',
  `time_updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `time_created` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`job_Id`)
) ENGINE=InnoDB AUTO_INCREMENT=242 DEFAULT CHARSET=utf8;
