/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 FUNCTION `F_G_createNewHunterTalentJob`(IN_hunter_Account VARCHAR(20), IN_talent_id VARCHAR(11), IN_job_id INT(11)) RETURNS varchar(255) CHARSET utf8
BEGIN
DECLARE Result VARCHAR(255);
DECLARE hunterTalentJobExists INT(11);
DECLARE createResult INT(11);

/*check whether hunter_talent_job already exists in T_Hunter_Talent_Job*/
SELECT
	COUNT(*)
FROM
	T_Hunter_Talent_Job
WHERE
		hunter_talent_job_Hunter_account=IN_hunter_Account
	AND
		hunter_talent_job_Talent_id = IN_talent_id
	AND
		hunter_talent_job_Job_id = IN_job_id			
		
INTO hunterTalentJobExists;


IF hunterTalentJobExists
THEN
	SET Result='FAILED@此人才已被推荐到此岗位';
	RETURN Result;
ELSE
/* insert talent info */
INSERT INTO T_Hunter_Talent_Job
			(
			hunter_talent_job_hunter_Account,
			hunter_talent_job_talent_id,
			hunter_talent_job_job_id,
			hunter_talent_job_status,
			hunter_talent_job_status_update_time,
