			hunter_talent_job_talent_weight,
			hunter_talent_job_talent_born_year,
			hunter_talent_job_talent_sex_id,
			hunter_talent_job_talent_mobile,
			hunter_talent_job_talent_mail,
			hunter_talent_job_talent_qq,
			hunter_talent_job_talent_hukou,
			hunter_talent_job_talent_born_place,
			hunter_talent_job_talent_location_type_id,
			hunter_talent_job_talent_live_id,
			hunter_talent_job_talent_live_street,
			hunter_talent_job_talent_self_comment,
			hunter_talent_job_talent_hobby,
			hunter_talent_job_talent_feature,
			hunter_talent_job_video_url,
			hunter_talent_job_wuguan,
			hunter_talent_job_pifu,
			hunter_talent_job_xiushi,
			hunter_talent_job_qizhi,
			hunter_talent_job_tantu,
			hunter_talent_job_juzhi,
			hunter_talent_job_goutong,
			hunter_talent_job_xiaoshou,
			time_updated,
			time_created
			) 

			SELECT
				IN_hunter_Account,
				IN_talent_id,
				IN_job_id,
				1,/*1 means 待选择*/
				NOW(),
				hunter_talent_Talent_id_card,
				hunter_talent_Talent_name,
				hunter_talent_Talent_height,
				hunter_talent_Talent_weight,
				hunter_talent_Talent_born_year,
				hunter_talent_Talent_sex_id,
				hunter_talent_Talent_mobile,
				hunter_talent_Talent_mail,
				hunter_talent_Talent_qq,
				hunter_talent_Talent_hukou,
				hunter_talent_Talent_born_place,
				hunter_talent_Talent_location_type_id,
				hunter_talent_Talent_live_id,
				hunter_talent_Talent_live_street,
				hunter_talent_Talent_self_comment,
				hunter_talent_Talent_hobby,
				hunter_talent_Talent_feature,
				hunter_talent_Video_url,
				hunter_talent_Wuguan,
				hunter_talent_Pifu,
				hunter_talent_Xiushi,
				hunter_talent_Qizhi,
				hunter_talent_Tantu,
				hunter_talent_Juzhi,
				hunter_talent_Goutong,
				hunter_talent_Xiaoshou,
				null,
				null
			FROM
				T_Hunter_Talent
			WHERE
					hunter_talent_Hunter_account = IN_hunter_Account
				AND
					hunter_talent_Talent_id = IN_talent_id;

	SET createResult = ROW_COUNT();

	IF createResult = 1
	THEN
		/* insert talent work experience */
		INSERT INTO
			T_Hunter_Talent_Job_Work_experience
			SELECT				
				hunter_talent_work_experience_Talent_id,
				hunter_talent_work_experience_Hunter_account,
				IN_job_id,
				hunter_talent_work_experience_Company,
				hunter_talent_work_experience_Start_date,
				hunter_talent_work_experience_End_date,
				hunter_talent_work_experience_Position,
				hunter_talent_work_experience_Salary,
				hunter_talent_work_experience_Job_quit_reason_type,
				hunter_talent_work_experience_Job_quit_reason_Des,
				null,
				null
			FROM
				T_Hunter_Talent_Work_experience
			WHERE
					hunter_talent_work_experience_Talent_id = IN_talent_id
				AND
					hunter_talent_work_experience_Hunter_account = IN_hunter_Account;

		/* insert talent edu */
		INSERT INTO
