				hunter_talent_edu_Degree_id,
				hunter_talent_edu_Start_date,
				hunter_talent_edu_End_date,				
				null,
				null
			FROM
				T_Hunter_Talent_Edu
			WHERE
					hunter_talent_edu_Talent_id = IN_talent_id
				AND
					hunter_talent_edu_Hunter_account = IN_hunter_Account;


		SET Result='SUCCESS@推荐成功!';
	ELSE
		SET Result='FAILED@没找到所要推荐的人才';
	END IF;
		
	RETURN Result;
END IF;
END */;;
