/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `P_activeJobListForEnterprise`(IN_enterPriseUserAccount VARCHAR(20), IN_jobKeyWord varchar(50), IN_offset INT(11), IN_limit INT(11))
    COMMENT '搜索激活状态的所有项目，接收参数IN_enterpriseUserAccount VARCHAR(20)用来生成指定项目的推荐总人数，待选择人数，被选择人数，被拒绝人数, IN_jobKeyWord varchar(50)用来生成关键字筛选职位名称，职位简述'
BEGIN
DECLARE offsetNum INT(11);
DECLARE limitNum INT(11);
DECLARE enterPriseUserAccount VARCHAR(20);
DECLARE keyWord VARCHAR(20);

IF (IN_offset IS NULL) THEN
	SET offsetNum = 0;
ELSE
	SET offsetNum = IN_offset;
END IF;

IF (IN_limit IS NULL) THEN
	SET limitNum = 18446744073709551615;
ELSE
	SET limitNum = IN_limit;
END IF;

SET enterPriseUserAccount = IN_enterPriseUserAccount;
SET keyWord = concat('%',IN_jobKeyWord,'%');

SELECT SQL_CALC_FOUND_ROWS
	job_Id,
	job_Title,
	job_Simple_des,
	CASE
		WHEN job_Salary_type_id = 1 THEN job_Salary_less
		WHEN job_Salary_type_id = 2 THEN CONCAT(job_Salary_less, '-', job_Salary_high)
		WHEN job_Salary_type_id = 3 THEN '面议'
		WHEN job_Salary_type_id = 4 THEN '和地区相关'
		ELSE '未指定'
	END AS R_salary,
	CASE
		WHEN job_Year_low IS NULL AND job_Year_high IS NULL THEN '无限制'
		WHEN job_Year_low IS NULL THEN job_Year_high
		WHEN job_Year_high IS NULL THEN job_Year_low
		ELSE CONCAT(job_Year_low, '-', job_Year_high)
	END AS R_work_experience,
	job_Recruit_num,
	CASE
		WHEN job_Commission_type_id = 1 THEN CONCAT(job_Commission, '元')
		WHEN job_Commission_type_id = 2 THEN CONCAT(FORMAT(job_Commission * 100, 0), '%')
	END AS R_commission,
	CASE
		WHEN job_Start_date IS NULL AND job_End_date IS NULL THEN '无限制'
		WHEN job_Start_date IS NULL OR job_Start_date = '0000-00-00' THEN CONCAT(job_End_date, '截止')
		WHEN job_End_date IS NULL OR job_End_date = '0000-00-00' THEN CONCAT(job_Start_date, '开始')
		ELSE CONCAT(job_Start_date, '到', job_End_date)
	END AS R_period_of_validity,
	job_Start_date,
	job_End_date,
	IFNULL(1StatusPersonNum, 0) R_submitted,
	IFNULL(2StatusPersonNum, 0) R_passed,
	IFNULL(3StatusPersonNum, 0) R_rejected,
	IFNULL(1StatusPersonNum, 0) + IFNULL(2StatusPersonNum, 0) + IFNULL(3StatusPersonNum, 0) totalPersonNum
FROM
	T_Job AS A
LEFT JOIN
	(
		SELECT
			hunter_talent_job_Job_id,
			count(*) 1StatusPersonNum
		FROM
			T_Hunter_Talent_Job
		WHERE
			hunter_talent_job_Status = 1
		GROUP BY
			hunter_talent_job_Job_id
	) AS B
ON
	A.job_Id = B.hunter_talent_job_Job_id
LEFT JOIN
	(
		SELECT
			hunter_talent_job_Job_id,
			count(*) 2StatusPersonNum
		FROM
			T_Hunter_Talent_Job
		WHERE
			hunter_talent_job_Status = 2
		GROUP BY
			hunter_talent_job_Job_id
	) AS C
ON
	A.job_ID = C.hunter_talent_job_Job_id
LEFT JOIN
	(
		SELECT
			hunter_talent_job_Job_id,
			count(*) 3StatusPersonNum
		FROM
			T_Hunter_Talent_Job
		WHERE
			hunter_talent_job_Status = 3
		GROUP BY
			hunter_talent_job_Job_id
	) AS D
ON
	A.job_ID = D.hunter_talent_job_Job_id
LEFT JOIN
	(
		SELECT
			job_location_Job_id,
			MAX(time_updated) R_job_location_time_updated
		FROM
			T_Job_Location
		GROUP BY
			job_location_Job_id
	) AS E
ON
	A.job_ID = E.job_location_Job_id
LEFT JOIN
	T_Salary_type AS F
ON
	A.job_Salary_type_id = F.salary_type_Id
LEFT JOIN
	(
		SELECT
			hunter_talent_job_Job_id,
			MAX(hunter_talent_job_Status_update_time) R_hunter_talent_job_status_update_time
		FROM
			T_hunter_talent_job
		GROUP BY
			hunter_talent_job_Job_id
	) AS G
ON
	A.job_ID = G.hunter_talent_job_Job_id
LEFT JOIN
	(
		SELECT
			job_degree_Job_id,
			MAX(time_updated) R_job_degree_time_updated
		FROM
			T_Job_Degree
		GROUP BY
			job_degree_Job_id
	) AS H
ON
	A.job_Id = H.job_degree_Job_id
WHERE
		A.job_Status_id = 1
	AND
		A.job_Enterprise_user_account = enterPriseUserAccount
	AND
		CASE
			WHEN keyWord is NULL THEN 1
			ELSE 
				(
					A.job_Title like keyWord
				OR
					A.job_Simple_des like keyWord
				)
		END
ORDER BY
	GREATEST(A.time_updated, IFNULL(E.R_job_location_time_updated, '0000-00-00 00:00:00'), IFNULL(H.R_job_degree_time_updated, '0000-00-00 00:00:00'), IFNULL(G.R_hunter_talent_job_status_update_time, '0000-00-00 00:00:00')) DESC
LIMIT
	offsetNum,
	limitNum
;
SELECT FOUND_ROWS() R_total_rows;
END */;;
DELIMITER ;
