	IFNULL(1StatusPersonNum, 0) R_1status,
	IFNULL(2StatusPersonNum, 0) R_2status,
	IFNULL(3StatusPersonNum, 0) R_3status,
	IFNULL(1StatusPersonNum, 0) + IFNULL(2StatusPersonNum, 0) + IFNULL(3StatusPersonNum, 0) totalPersonNum
FROM
