/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `P_G_createNewJob`(IN_title VARCHAR(40), IN_simple_des VARCHAR(200), IN_detail_des MEDIUMTEXT, IN_enterprise_user_account VARCHAR(20), IN_type_id INT(11), IN_status_id INT(11), IN_recruit_num INT(11), IN_year_low INT(11), IN_year_high INT(11), IN_salary_type_id INT(11), IN_salary_less INT(11), IN_salary_high INT(11), IN_commission_type_id INT(11), IN_commission DECIMAL(8,2), IN_start_date DATE, IN_end_date DATE, IN_locationList VARCHAR(255), IN_degreeList VARCHAR(255))
BEGIN
DECLARE divider SMALLINT;
DECLARE str VARCHAR(255);
DECLARE jobId INT(11);
CALL P_createNewJob
			(
			IN_title, 
			IN_simple_des, 
			IN_detail_des, 
			IN_enterprise_user_account, 
			IN_type_id, 
			IN_status_id, 
			IN_recruit_num, 
			IN_year_low, 
			IN_year_high, 
			IN_salary_type_id, 
			IN_salary_less, 
			IN_salary_high, 
			IN_commission_type_id, 
			IN_commission, 
			IN_start_date, 
			IN_end_date
			);

SET jobId = LAST_INSERT_ID();
WHILE IN_locationList <> '' DO
	SET divider = INSTR(IN_locationList,',');
	IF (divider > 0) 
	THEN
		SET str = SUBSTRING_INDEX(IN_locationList, ',', 1);
		SET IN_locationList = SUBSTRING(IN_locationList, divider+1);             
	ELSE 
		SET str = IN_locationList;
		SET IN_locationList = '';
	END IF;
