/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `P_huntersTalentNotInJobSortByUpdateTime`(IN_hunterAccount varchar(20), IN_jobId INT(11), IN_city INT(11), IN_talentName varchar(20), IN_offset INT(11), IN_limit INT(11))
    COMMENT '搜索所有属于此猎头且未被推荐到特定job的人才信息，接收参数IN_hunterAccount varchar(20)只选择指定猎头的人才信息, IN_jobId指定所有未推荐到此工作的人才，IN_city INT(11)根据人才所属城市筛选结果, IN_talentName varchar(20)根据人才名字模糊匹配筛选结果'
BEGIN
DECLARE offsetNum INT(11);
DECLARE limitNum INT(11);
DECLARE hunterAccount VARCHAR(20);
DECLARE jobId INT(11);
DECLARE city INT(11);
DECLARE talentName VARCHAR(20);

IF (IN_offset IS NULL) THEN
	SET offsetNum = 0;
ELSE
	SET offsetNum = IN_offset;
END IF;

IF (IN_limit IS NULL) THEN
	SET limitNum = 18446744073709551615;
ELSE
	SET limitNum = IN_limit;
END IF;

SET hunterAccount = IN_hunterAccount;
SET jobId = IN_jobId;
SET city = IN_city;
SET talentName = TRIM(IN_talentName);

SELECT SQL_CALC_FOUND_ROWS
	hunter_talent_Talent_Id,
	hunter_talent_Talent_Name,
	YEAR(NOW()) - YEAR(hunter_talent_Talent_born_year) R_age,
	sex_Name,
	IFNULL(R_city_name, '未知') R_city_name,
	hunter_talent_Talent_mobile,
	hunter_talent_Talent_qq,
	FORMAT(((hunter_talent_Wuguan
	+ hunter_talent_Pifu
	+ hunter_talent_Xiushi
	+ hunter_talent_Qizhi
	+ hunter_talent_Tantu
	+ hunter_talent_Juzhi
	+ hunter_talent_Goutong
	+ hunter_talent_Xiaoshou)/8),0) R_star,
	GREATEST
	(
		A.time_updated,
		CASE 
			WHEN B.R_hunter_talent_prefer_job_Update_time IS NULL THEN '0000-00-00 00:00:00'
			ELSE B.R_hunter_talent_prefer_job_Update_time
		END, 
		CASE 
			WHEN C.hunter_talent_edu_Update_time IS NULL THEN '0000-00-00 00:00:00'
			ELSE C.hunter_talent_edu_Update_time
		END,
		CASE 
			WHEN D.hunter_talent_Work_experience_Update_time IS NULL THEN '0000-00-00 00:00:00'
			ELSE D.hunter_talent_Work_experience_Update_time
		END
	) R_update_time
FROM
	T_Hunter_Talent AS A
LEFT JOIN
	(
		SELECT
			hunter_talent_prefer_job_Talent_id, MAX(time_updated) R_hunter_talent_prefer_job_Update_time
		FROM
			T_Hunter_Talent_Prefer_job
		WHERE
			hunter_talent_prefer_job_Hunter_account = hunterAccount
		GROUP BY
			hunter_talent_prefer_job_Talent_id
	) AS B
ON
	A.hunter_talent_Talent_id = B.hunter_talent_prefer_job_Talent_id
LEFT JOIN
	(
		SELECT
			hunter_talent_edu_Talent_id, MAX(time_updated) hunter_talent_edu_Update_time
		FROM
			T_Hunter_Talent_Edu
		WHERE
			hunter_talent_edu_Hunter_account = hunterAccount
		GROUP BY
			hunter_talent_edu_Talent_id
	) AS C
ON
	A.hunter_talent_Talent_id = C.hunter_talent_edu_Talent_id
LEFT JOIN
	(
		SELECT
			hunter_talent_Work_experience_Talent_id, MAX(time_updated) hunter_talent_Work_experience_Update_time
		FROM
			T_Hunter_Talent_Work_experience
		WHERE
			hunter_talent_Work_experience_Hunter_account = hunterAccount
		GROUP BY
			hunter_talent_Work_experience_Talent_id
	) AS D
ON
	A.hunter_talent_Talent_id = D.hunter_talent_Work_experience_Talent_id
LEFT JOIN
	T_Sex AS E
ON
	A.hunter_talent_Talent_sex_id = E.sex_Id
LEFT JOIN
	V_Location_info AS F
ON
		A.hunter_talent_Talent_location_type_id = F.location_Type_id
	AND
		A.hunter_talent_Talent_live_id = F.location_id
WHERE
	hunter_talent_Hunter_account = hunterAccount
	AND
		CASE
			WHEN city is NULL THEN 1
			ELSE hunter_talent_Talent_Location_type_id = 2 AND hunter_talent_Talent_live_id = city
		END
	AND
		CASE
			WHEN talentName is NULL THEN 1
			ELSE hunter_talent_Talent_name like CONCAT('%',talentName,'%')
		END
	AND
		NOT EXISTS
		(
			SELECT
				*
			FROM
				T_hunter_talent_job AS Z
			WHERE
					Z.hunter_talent_job_Hunter_account = hunterAccount
				AND
					Z.hunter_talent_job_Job_id = jobId
				AND
					Z.hunter_talent_job_Talent_id = A.hunter_talent_Talent_id
		)
ORDER BY
	R_update_time DESC
LIMIT
	offsetNum,
	limitNum
;
SELECT FOUND_ROWS() R_total_rows;
END */;;
