/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `P_systemTalentSortByUpdateTime`(IN_city INT(11), IN_talentName varchar(20))
    COMMENT '搜索所有属于猎头的人才信息，接收参数IN_hunterAccount varchar(20)只选择指定猎头的人才信息, IN_city INT(11)根据人才所属城市筛选结果, IN_talentName varchar(20)根据人才名字模糊匹配筛选结果'
BEGIN
DECLARE city INT(11);
DECLARE talentName VARCHAR(20);

SET city = IN_city;
SET talentName = CONCAT('%',TRIM(IN_talentName),'%');

SELECT
	*
FROM
	T_Talent AS A
LEFT JOIN
	(
		SELECT
			talent_edu_Talent_id, MAX(time_updated) talent_edu_Update_time
		FROM
			T_Talent_Edu
		GROUP BY
			talent_edu_Talent_id
	) AS B
ON
	A.talent_Id = B.talent_edu_Talent_id
LEFT JOIN
	(
		SELECT
			talent_work_experience_Talent_id, MAX(time_updated) talent_work_experience_Update_time
		FROM
			T_Talent_Work_experience
		GROUP BY
			talent_work_experience_Talent_id
	) AS C
	ON
	A.talent_Id = C.talent_work_experience_Talent_id
WHERE
		CASE
			WHEN city is NULL THEN 1
			ELSE talent_Location_type_id = 2 AND talent_Live_id = city
		END
	AND
		CASE
			WHEN talentName is NULL THEN 1
			ELSE talent_Name like CONCAT('%',talentName,'%')
		END;
END */;;
DELIMITER ;
