    DETERMINISTIC
    COMMENT '搜索猎头推荐人才到职位记录，按照记录推荐状态排序，接收参数IN_enterpriseUserAccount varchar(20)只取指定用人单位的记录, IN_city INT(11)用来根据人才所属城市筛选结果, IN_talentName varchar(20)用来根据人才姓名模糊匹配筛选结果'
