/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `P_updateJob`(IN_id INT(11), IN_time_updated DATETIME, IN_title VARCHAR(40), IN_simple_des VARCHAR(200), IN_detail_des MEDIUMTEXT, IN_enterprise_user_account VARCHAR(20), IN_type_id INT(11), IN_status_id INT(11), IN_recruit_num INT(11), IN_year_low INT(11), IN_year_high INT(11), IN_salary_type_id INT(11), IN_salary_less INT(11), IN_salary_high INT(11), IN_commission_type_id INT(11), IN_commission DECIMAL(8,2), IN_start_date DATE, IN_end_date DATE)
    DETERMINISTIC
BEGIN
DECLARE Result INT(11);
DECLARE newJobId INT(11);

SET IN_enterprise_user_account = IFNULL(IN_enterprise_user_account, 'systemDefault');
SET IN_type_id = IFNULL(IN_type_id, 10); /*id 10 in T_Job_type is '其他职位'*/
SET IN_status_id = 1; /*新建职位默认为1:激活状态*/
SET IN_salary_type_id = 1; /*新建职位默认为1:固定数额*/

UPDATE
	T_Job
SET 
	job_Title = IN_title,
	job_Simple_des = IN_simple_des, 
	job_Detail_des = IN_detail_des, 
	job_Enterprise_user_account = IN_enterprise_user_account, 
	job_Type_id = IN_type_id, 
	job_Status_id = IN_status_id, 
	job_Recruit_num = IN_recruit_num, 
	job_Year_low = IN_year_low, 
	job_Year_high = IN_year_high, 
	job_Salary_type_id = IN_salary_type_id,  
	job_Salary_less = IN_salary_less, 
	job_Salary_high = IN_salary_high, 
	job_Commission_type_id = IN_commission_type_id, 
	job_Commission = IN_commission, 
	job_Start_date = IN_start_date, 
	job_End_date = IN_end_date
WHERE
	job_Id = IN_id
AND
	time_updated = IN_time_updated;

IF (ROW_COUNT() = 1)
THEN	
		SET Result = 1;
ELSEIF (ROW_COUNT() = 0)
THEN
		SET Result = 0;
ELSE
		CALL RAISE_ERROR_P_updateJob;
END IF;
SELECT Result;
END */;;
